CREATE DATABASE IF NOT EXISTS app_insight;

-- app_download_task APP下载任务表
CREATE TABLE IF NOT EXISTS `app_insight`.`app_download_task`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '主键 ID',
  `app_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '应用 ID（内部唯一标识）',
  `version_code` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '应用版本号（code）',
  `version_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '应用版本名（name）',
  `is_gp_listing` tinyint NULL DEFAULT 0 COMMENT '应用是否在GooglePlay上架',
  `developer` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '应用开发商',
  `source` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '下载来源（如 Google Play、APKPure、内部等）',
  `status` int NULL DEFAULT 0 COMMENT '任务状态：0-pending，1-downloading，2-success，3-failed，4-retrying',
  `retry_count` int NULL DEFAULT 0 COMMENT '下载重试次数',
  `error_message` varchar(2048) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '错误信息（仅在失败时记录）',
  `file_path` varchar(2048) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '下载后文件的本地路径',
  `created_at` datetime(3) NULL DEFAULT NULL COMMENT '任务创建时间',
  `updated_at` datetime(3) NULL DEFAULT NULL COMMENT '最后更新时间',
  `started_at` datetime(3) NULL DEFAULT NULL COMMENT '下载开始时间',
  `finished_at` datetime(3) NULL DEFAULT NULL COMMENT '下载完成时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_app_id`(`app_id` ASC) USING BTREE,
  INDEX `idx_status`(`status` ASC) USING BTREE,
  INDEX `idx_created_at`(`created_at` ASC) USING BTREE,
  INDEX `idx_updated_at`(`updated_at` ASC) USING BTREE,
  INDEX `idx_started_at`(`started_at` ASC) USING BTREE,
  INDEX `idx_finished_at`(`finished_at` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 0 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '应用下载任务表' ROW_FORMAT = Dynamic;

-- app_analysis_task APP分析任务表
CREATE TABLE IF NOT EXISTS `app_insight`.`app_analysis_task` (
  `id` BIGINT NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `app_id` VARCHAR(64) NOT NULL COMMENT '应用ID',
  `version_code` VARCHAR(32) DEFAULT NULL COMMENT '版本号',
  `version_name` VARCHAR(64) DEFAULT NULL COMMENT '版本名',
  `is_gp_listing` TINYINT DEFAULT 0 COMMENT 'GooglePlay上架:0=否,1=是',
  `developer` VARCHAR(128) DEFAULT NULL COMMENT '开发商',
  `error_message` VARCHAR(2048) COMMENT '错误信息（仅在失败时记录）',
  `file_analysis_status` TINYINT NOT NULL DEFAULT 0   COMMENT '文件分析状态',
  `file_analysis_started_at` DATETIME(3) DEFAULT NULL,
  `file_analysis_finished_at` DATETIME(3) DEFAULT NULL,
  `code_analysis_status` TINYINT NOT NULL DEFAULT 0  COMMENT '代码分析状态',
  `code_analysis_started_at` DATETIME(3) DEFAULT NULL,
  `code_analysis_finished_at` DATETIME(3) DEFAULT NULL,
  `dynamic_analysis_status` TINYINT NOT NULL DEFAULT 0  COMMENT '动态分析状态',
  `dynamic_analysis_started_at` DATETIME(3) DEFAULT NULL,
  `dynamic_analysis_finished_at` DATETIME(3) DEFAULT NULL,
  `created_at` DATETIME(3) COMMENT '任务创建时间',
  `updated_at` DATETIME(3) COMMENT '最后更新时间',
  PRIMARY KEY (`id`),
  INDEX `idx_app_created` (`app_id`, `created_at` DESC),
  INDEX `idx_app_id`(`app_id` ASC) USING BTREE,
  INDEX `idx_created_at`(`created_at` ASC) USING BTREE,
  INDEX `idx_status_updated` (`file_analysis_status`, `code_analysis_status`, `dynamic_analysis_status`, `updated_at` DESC)
) ENGINE = InnoDB AUTO_INCREMENT = 0 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '应用分析任务表' ROW_FORMAT = Dynamic;

-- app_sdk_match_rule APP匹配规则表
CREATE TABLE IF NOT EXISTS `app_insight`.`app_sdk_match_rule`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `sdk_metadata_id` int UNSIGNED NULL DEFAULT NULL COMMENT 'SDK信息主键ID',
  `xml_scan_rules` varchar(2048) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'xml匹配规则',
  `global_scan_rules` varchar(2048) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '全局匹配规则',
  `bk_string1` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备用字符串字段1',
  `bk_string2` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备用字符串字段2',
  `bk_int1` int NULL DEFAULT NULL COMMENT '备用Int字段1',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 0 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'SDK匹配规则' ROW_FORMAT = DYNAMIC;

-- sdk_metadata	SDK元信息表
CREATE TABLE IF NOT EXISTS `app_insight`.`sdk_metadata`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `sdk_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'SDK名称',
  `developer_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '开发者名称',
  `icon_file_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '图标文件URL',
  `maven_identifiers` varchar(4096) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'Maven标识符（JSON数组格式）',
  `is_play_registered` tinyint(1) NOT NULL COMMENT '是否在Play商店注册（0表示否，1表示是）',
  `sdk_page_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'SDK页面URL',
  `repository` tinyint(1) NOT NULL COMMENT '是否为仓库（0表示否，1表示是）',
  `private_repo_url` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '私有仓库URL',
  `public_categories` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '公开分类（JSON数组格式）',
  `data_safety_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '数据安全URL',
  `is_google_owned` tinyint(1) NOT NULL COMMENT '是否为Google所有（0表示否，1表示是）',
  `is_deprecated` tinyint(1) NOT NULL COMMENT '是否已弃用（0表示否，1表示是）',
  `created_at` datetime(3) NULL DEFAULT NULL,
  `updated_at` datetime(3) NULL DEFAULT NULL,
  `deleted_at` datetime(3) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_sdk_info_deleted_at`(`deleted_at` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 0 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'SDK元信息表' ROW_FORMAT = Dynamic;

-- ad_unit_push_log 广告位推送记录表
CREATE TABLE IF NOT EXISTS `app_insight`.`ad_unit_push_log`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `platform` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '渠道',
  `params_dict` varchar(2048) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '参数字典',
  `params_dict_md5` varchar(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '参数字典的md5值，主要用于去重',
  `os` int NULL DEFAULT 0 COMMENT '设备类型1:ios,2:android 3:pc',
  `push_status` int NULL DEFAULT 0 COMMENT '推送状态，0-推送失败。1-推送成功',
  `is_available` int NULL DEFAULT 0,
  `source_app` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '来源的app名称',
  `created_at` datetime(3) NULL DEFAULT NULL,
  `updated_at` datetime(3) NULL DEFAULT NULL,
  `deleted_at` datetime(3) NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `idx_params_dict_md5`(`platform`, `params_dict_md5` ASC) USING BTREE,
  INDEX `idx_push_status`(`platform`, `push_status` ASC) USING BTREE,
  INDEX `idx_is_available`(`platform`, `is_available` ASC) USING BTREE,
  INDEX `idx_params_dict_md5`(`params_dict_md5` ASC) USING BTREE,
  INDEX `idx_deleted_at`(`deleted_at` ASC) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 0 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '广告位推送记录' ROW_FORMAT = Dynamic;

-- app_sdk_match_result APP-SDK匹配结果表
CREATE TABLE IF NOT EXISTS `app_insight`.`app_sdk_match_result`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `app_analysis_task_id` int NULL DEFAULT NULL COMMENT '包名主键ID',
  `sdk_metadata_id` int NULL DEFAULT NULL COMMENT 'SDK信息主键ID',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 0 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = 'APK-SDK匹配结果表' ROW_FORMAT = DYNAMIC;

